        //Determine and set numbers of all curent state table severasl kinds node.
        public void SetObjectNumbers(int[,] TabS)
        {
            //long Time = TimeElapced.TimeNow();Spaces++;
            Object a = new Object();
            lock (a)
            {
                //Initiate
                SodierMidle = 0;
                SodierHigh = 0;
                ElefantMidle = 0;
                ElefantHigh = 0;
                HourseMidle = 0;
                HourseHight = 0;
                CastleMidle = 0;
                CastleHigh = 0;
                MinisterMidle = 0;
                MinisterHigh = 0;
                KingMidle = 0;
                KingHigh = 0;
                for (int h = 0; h < 8; h++)
                    for (int s = 0; s < 8; s++)
                    {
                        //Cal Solider Gray
                        if (TabS[h, s] == 1)
                        {
                            //Increase
                            SodierMidle++;
                            SodierHigh++;
                        }//Elephant Gray
                        else if (TabS[h, s] == 2)
                        {
                            //Increase
                            ElefantMidle++;
                            ElefantHigh++;
                        }
                        //Hoirse Gray
                        else if (TabS[h, s] == 3)
                        {
                            //Increase
                            HourseMidle++;
                            HourseHight++;
                        }
                        //Castle Gray
                        else if (TabS[h, s] == 4)
                        {
                            //Increase
                            CastleMidle++;
                            CastleHigh++;
                        }
                        //Minister Gray
                        else if (TabS[h, s] == 5)
                        {
                            //Increase
                            MinisterMidle++;
                            MinisterHigh++;
                        }
                        //King Gray
                        else if (TabS[h, s] == 6)
                        {
                            //Increase
                            KingMidle++;
                            KingHigh++;
                        }
                        else//Solder Brown
                            if (TabS[h, s] == -1)
                        {
                            //Increase
                            SodierHigh++;
                        }
                        else if (TabS[h, s] == -2)//Elepant Brown
                        {
                            //Increase
                            ElefantHigh++;
                        }
                        else if (TabS[h, s] == -3)//Hourse Brown
                        {
                            //Increase
                            HourseHight++;
                        }
                        else if (TabS[h, s] == -4)//Castle Brown
                        {
                            //Increase
                            CastleHigh++;
                        }
                        else if (TabS[h, s] == -5)//Mincter Brown
                        {
                            //Increase
                            MinisterHigh++;
                        }
                        else if (TabS[h, s] == -6)//King Brown
                        {
                            //Incrrease
                            KingHigh++;
                        }
                    }
            }
            //{ AllDraw.OutPut.Append("\r\n");for (int l = 0; l < Spaces; l++) AllDraw.OutPut.Append(Space);  AllDraw.OutPut.Append("SetObjectNumbers:" + (TimeElapced.TimeNow() - Time).ToString());}Spaces--;

        }
        //Found of Specific Objects uniqued
        float[] FoundLocationOfObject(ref int[,] Tabl, int Kind, bool IsGray)
        {
            //long Time = TimeElapced.TimeNow();Spaces++;
            Object a = new Object();
            lock (a)
            {
                //Initaite
                float[] Location = { -1, -1 };
                //Locate and search
                for (var i = 0; i < 8; i++)
                    for (var j = 0; j < 8; j++)
                    {
                        //When is Gray
                        if (IsGray)
                        {
                            //When object found
                            if (Tabl[i, j] == Kind)
                            {
                                //Srote location
                                Location[0] = i;
                                Location[1] = j;
                                //Clear Objects from table
                                Tabl[i, j] = 0;

                            }
                        }
                        else//Is Brown
                        {
                            //When Found
                            if (Tabl[i, j] * -1 == Kind)
                            {
                                //Store Location
                                Location[0] = i;
                                Location[1] = j;
                                //Clear from table
                                Tabl[i, j] = 0;

                            }
                        }

                    }
                //{ AllDraw.OutPut.Append("\r\n");for (int l = 0; l < Spaces; l++) AllDraw.OutPut.Append(Space);  AllDraw.OutPut.Append("FoundLocationOfObject:" + (TimeElapced.TimeNow() - Time).ToString());}Spaces--;
                //returnb location
                return Location;

            }
        }
