        //when index is out of boundry return false when is valid return true
        bool BondryObjectNumber(int i, int Kind, int Order)
        {
            bool Is = true;
            if (Order == 1)
            {
                if (Kind == 1)
                {
                    if (i >= SodierMidle)
                        Is = false;
                }
                else
                    if (Kind == 2)
                {
                    if (i >= ElefantMidle)
                        Is = false;
                }
                else
                    if (Kind == 3)
                {
                    if (i >= HourseMidle)
                        Is = false;
                }
                else
                    if (Kind == 4)
                {
                    if (i >= CastleMidle)
                        Is = false;
                }
                else
                    if (Kind == 5)
                {
                    if (i >= MinisterMidle)
                        Is = false;
                }
                else
                    if (Kind == 6)
                {
                    if (i >= KingMidle)
                        Is = false;
                }
            }
            else
            {
                if (Kind == 1)
                {
                    if (i < SodierMidle || i >= SodierHigh)
                        Is = false;
                }
                else
                   if (Kind == 2)
                {
                    if (i < ElefantMidle || i >= ElefantHigh)
                        Is = false;
                }
                else
                   if (Kind == 3)
                {
                    if (i < HourseMidle || i >= HourseHight)
                        Is = false;
                }
                else
                   if (Kind == 4)
                {
                    if (i < CastleMidle || i >= CastleHigh)
                        Is = false;
                }
                else
                   if (Kind == 5)
                {
                    if (i < MinisterMidle || i >= MinisterHigh)
                        Is = false;
                }
                else
                   if (Kind == 6)
                {
                    if (i < KingMidle || i >= KingHigh)
                        Is = false;
                }
            }
            return Is;
        }
