            {
                SOut = "Soldier ";
            }
            else
                if (Obj == 2)
            {
                SOut = "Elephant ";
            }
            else
                if (Obj == 3)
            {
                SOut = "Hourse ";
            }
            else
                if (Obj == 4)
            {
                SOut = "Castle ";
            }
            else
                if (Obj == 5)
            {
                SOut = "Minister ";
            }
            else
                    if (Obj == 6)
            {
                SOut = "King ";
            }
            SOut += "AStar Huristics ";
