                SOut += " -Initiatetion- ";
            if (Sec == 2)
                SOut += " -Regard- ";
            if (Sec == 3)
                SOut += " -Foundation Greatest- ";
            if (WinOcuuredatChiled >= 1)
                SOut += " At -WinKing Checked Mate- is active For Eneter Regard- ";
            if (LoseOcuuredatChiled <= -1)
                SOut += " At -LoseKing Checked Mate- is active For Eneter Penelty- ";
            if (AA)
