                            if (SolderesOnTable[i].SoldierThinking[k].AStarGreedy.Count > j)
                                SolderesOnTable[i].SoldierThinking[k].AStarGreedy[j].IsFoundOfLeafDepenOfKindhaveVictory(1, ref AA, Order * -1);
                            ChessRules.CurrentOrder *= -1;
                            Order *= -1;
