        {
            //long Time = TimeElapced.TimeNow();Spaces++;
            //gray
            if (Order == 1)
            {
                //sodier
                for (var i = 0; i < SodierMidle; i++)
                {
                    if (SolderesOnTable == null || SolderesOnTable[i] == null)
                        continue;
                    ServeISSup(Order, 1, i);
                }
                //elephant
                for (var i = 0; i < ElefantMidle; i++)
                {
