                {
                    if (KingOnTable == null || KingOnTable[i] == null)
                        continue;
                    ServeISSup(Order, 6, i);
                }

            }//brown
            else
            {   //soldier
                for (var i = SodierMidle; i < SodierHigh; i++)
                {
                    if (SolderesOnTable == null || SolderesOnTable[i] == null)
                        continue;
                    ServeISSup(Order, 1, i);
